import React from 'react';
import { Link } from 'react-router-dom';
import { Calendar, Shield, Clock, Heart } from 'lucide-react';
import Button from '../components/common/Button';

const Home = () => {
  const features = [
    {
      icon: Calendar,
      title: 'Εύκολη Κράτηση',
      description: 'Κλείστε ραντεβού σε λίγα απλά βήματα'
    },
    {
      icon: Shield,
      title: 'Ασφάλεια',
      description: 'Πιστοποιημένοι επαγγελματίες'
    },
    {
      icon: Clock,
      title: 'Ευέλικτο Ωράριο',
      description: 'Διαθέσιμοι όλες τις ημέρες της εβδομάδας'
    },
    {
      icon: Heart,
      title: 'Φροντίδα με Αγάπη',
      description: 'Μεταχειριζόμαστε τα κατοικίδιά σας σαν δικά μας'
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100">
      {/* Hero Section */}
      <section className="py-20 px-4">
        <div className="max-w-6xl mx-auto text-center">
          <h1 className="text-5xl md:text-6xl font-bold text-gray-800 mb-6">
            Φροντίδα για όλα τα<br />
            <span className="text-indigo-600">Κατοικίδιά σας</span>
          </h1>
          <p className="text-xl text-gray-600 mb-8 max-w-2xl mx-auto">
            Κλείστε εύκολα ραντεβού για τον μικρό σας φίλο.
            Σκύλοι, γάτες, πουλιά και πολλά άλλα!
          </p>
          <div className="flex flex-col sm:flex-row gap-4 justify-center">
            <Link to="/booking">
              <Button size="lg">
                Κάντε Κράτηση Τώρα
              </Button>
            </Link>
            <Link to="/register">
              <Button size="lg" variant="outline">
                Εγγραφή
              </Button>
            </Link>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="py-16 px-4 bg-white">
        <div className="max-w-6xl mx-auto">
          <h2 className="text-3xl font-bold text-center text-gray-800 mb-12">
            Γιατί να μας επιλέξετε;
          </h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
            {features.map((feature, index) => (
              <div key={index} className="text-center p-6 rounded-xl hover:bg-gray-50 transition">
                <div className="w-16 h-16 bg-indigo-100 rounded-full flex items-center justify-center mx-auto mb-4">
                  <feature.icon className="w-8 h-8 text-indigo-600" />
                </div>
                <h3 className="text-xl font-semibold text-gray-800 mb-2">
                  {feature.title}
                </h3>
                <p className="text-gray-600">
                  {feature.description}
                </p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-16 px-4">
        <div className="max-w-4xl mx-auto bg-indigo-600 rounded-2xl p-12 text-center text-white">
          <h2 className="text-3xl font-bold mb-4">
            Έτοιμοι να ξεκινήσετε;
          </h2>
          <p className="text-xl mb-8 opacity-90">
            Κλείστε το πρώτο σας ραντεβού σήμερα!
          </p>
          <Link to="/booking">
            <Button size="lg" variant="secondary">
              Κράτηση Ραντεβού
            </Button>
          </Link>
        </div>
      </section>
    </div>
  );
};

export default Home;
